import React, { Component } from 'react';
import './scss/App.scss';

export class Slide2 extends Component {
  render(){
    return(
      <div className="slide2">  <h1>COMPARE YOURSELF</h1>
      <h1>TO THE BIGGEST</h1></div>
    )
  }
}

export default Slide2;
